import React, { useState } from "react";
import { motion } from "framer-motion";
import "./App.css";

const App = () => {
  const [activeTab, setActiveTab] = useState("Home");

  const renderContent = () => {
    switch (activeTab) {
      case "Home":
        return <UpcomingInterviews />;
      case "Interviewers":
        return <InterviewersTable />;
      case "Candidates":
        return <CandidatesTable />;
      case "Reports":
        return <Reports />;
      case "Settings":
        return <Settings />;
      default:
        return <UpcomingInterviews />;
    }
  };

  return (
    <div className="app-container">
      <h1 className="dashboard-title">Interview Management Dashboard</h1>

      {/* Navigation Bar with Lavalamp Effect */}
      <nav className="lavalamp-menu">
        <ul>
          {["Home", "Interviewers", "Candidates", "Reports", "Settings"].map((tab) => (
            <li
              key={tab}
              className={`nav-item ${activeTab === tab ? "active" : ""}`}
              onClick={() => setActiveTab(tab)}
            >
              {tab}
            </li>
          ))}
          <div className="lavalamp"></div>
        </ul>
      </nav>

      <motion.div
        className="content"
        key={activeTab}
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        exit={{ opacity: 0, y: -20 }}
        transition={{ duration: 0.3 }}
      >
        {renderContent()}
      </motion.div>
    </div>
  );
};

const UpcomingInterviews = () => (
  <div className="upcoming-interviews">
    <h2>Upcoming Interviews</h2>
    <ul>
      <li>Interview with John Doe</li>
      <li>Interview with Jane Smith</li>
    </ul>
  </div>
);

const InterviewersTable = () => (
  <div className="table-container">
    <h2>Interviewers</h2>
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Email ID</th>
          <th>More Details</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>Dr. Alice Johnson</td>
          <td>alice@example.com</td>
          <td><button>Details</button></td>
        </tr>
        <tr>
          <td>Mr. Bob Lee</td>
          <td>bob@example.com</td>
          <td><button>Details</button></td>
        </tr>
      </tbody>
    </table>
  </div>
);

const CandidatesTable = () => (
  <div className="table-container">
    <h2>Candidates</h2>
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Email ID</th>
          <th>More Details</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>Emily Davis</td>
          <td>emily@example.com</td>
          <td><button>Details</button></td>
        </tr>
        <tr>
          <td>Mark Brown</td>
          <td>mark@example.com</td>
          <td><button>Details</button></td>
        </tr>
      </tbody>
    </table>
  </div>
);

const Reports = () => (
  <div className="reports">
    <h2>Reports</h2>
    <ul>
      <li>Total Interviews: 10</li>
      <li>Upcoming Interviews: 2</li>
      <li>Completed Interviews: 8</li>
    </ul>
  </div>
);

const Settings = () => (
  <div className="settings">
    <h2>Settings</h2>
    <p>Change Theme: Light / Dark</p>
  </div>
);

export default App;
